import fetch from 'isomorphic-unfetch';
const index = (props)=> (
<Layout>
   <div>


    <style global jsx>{`
  body{
      background: #333;
  }
  
  
  `}</style>
    </div>
    </Layout>
  
    );

    index.getCouuntry = async function () {
        const api = await fetch('https://restcountries.eu/rest/v2/all');
        const data = await api.json();

        console.log(data);
    }
    export default index;
